import React from 'react';
import Navigationbar from "./components/navigationbar";
import './App.css';
import Home from "./pages/home"

function App() {
    var sectionStyle = {
        width: "100%",
        height: "400px",
        color : "red"
    };
  return (
    <div className="App" style={sectionStyle} >
      <Navigationbar/>
      <Home/>
    </div>
  );
}

export default App;
